	for i, tc := range testCases {
		t.Run(strconv.Itoa(i)+"-"+tc.theme, func(t *testing.T) {
			opt := CandlestickChartOption{
				Theme: GetTheme(tc.theme),
				XAxis: XAxisOption{
					Labels: []string{"T1", "T2", "T3", "T4", "T5"},
				},
				YAxis:      make([]YAxisOption, 1),
				SeriesList: seriesList,
				Legend: LegendOption{
					SeriesNames: seriesNames,
					Show:        Ptr(true),
				},
				Padding: NewBoxEqual(10),
			}

			painterOptions := PainterOptions{
				OutputFormat: ChartOutputSVG,
				Width:        1200,
				Height:       800,
			}
			p := NewPainter(painterOptions)

			err := p.CandlestickChart(opt)
			require.NoError(t, err)

			buf, err := p.Bytes()
			require.NoError(t, err)
			assertEqualSVG(t, tc.expectedSVG, buf)
		})
	}
